import React from 'react'

class DisplayList extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                {this.props.list.map(item => 
                    <li>{item.name}, {item.size}</li>)}
            </div>

        )
    }

}

export default DisplayList
